import React from 'react';
import './cart.css';
import {removeCart} from '../../redux/index';
import {connect} from 'react-redux'



const CartPage = () => {
    return ( 
        <div className="cartPage">
            <div  className="cartTitle">
                <img className="cartLogo" src={require('./cart.png')} alt="icehockey" />
                    <div>Your Cart</div>
                <img className="cartLogo" src={require('./cart.png')} alt="icehockey" />
            </div>

            <div className="itemsContainer">
                <div className="itemsTitle">Your Items:</div><br/>

                {/* <ul className="list">
                    <div className="itemAndButton">
                        <li className="listItem">Item 1</li>
                        <button className="remove">remove</button>
                    </div>
                    <div className="itemAndButton">
                        <li className="listItem">Item 1</li>
                        <button className="remove">remove</button>
                    </div>
                    <div className="itemAndButton">
                        <li className="listItem">Item 1</li>
                        <button className="remove">remove</button>
                    </div>
                </ul> */}

                <div className="bottomLine">-</div>
                <div className="total">Total: $1299.99</div>
            </div>
        </div>
     );
}


const mapStateToProps=state=>{
    return {
        numItems: state.cart
    }
}

const mapDispatchToProps = dispatch=>{
    return{
        removeCart: itemId=>dispatch(removeCart(itemId))
    }
}
 
export default connect(mapStateToProps, mapDispatchToProps)(CartPage)
